  const win = typeof (window as any) !== 'undefined' ? window : null as any;

  if (win != null) {
    const Ionic = win.Ionic;
    if (Ionic && Ionic.queue) {
      return Ionic.queue;
    }

    return {
      read: (cb: any) => win.requestAnimationFrame(cb),
      write: (cb: any) => win.requestAnimationFrame(cb)
    };
  }

  return {
    read: (cb: any) => cb(),
    write: (cb: any) => cb()
  };
};

